import { Flex, Box, Heading, Spacer, Button, Input } from "@chakra-ui/react";
import React from "react";



 interface NavbarProps {
    name?: string;
  }



 export const Navbar: React.FC<NavbarProps> = (props) => {
    function alerting(){
        let date = new Date();
        let dateString = new String((date.getUTCHours()-6).toString());
        dateString = dateString.concat(":", date.getUTCMinutes().toString(),":",date.getUTCMilliseconds().toString());

        console.log(dateString)
    }
    return (
        <Flex>
        <Box p="2" >
          <Heading size="md" fontStyle='italic' colorScheme="teal">Parqueo TEC</Heading>
        </Box>
        <Spacer />
        <Box>
          <Button colorScheme="teal" mr="4" onClick={alerting}>
            Refresh
          </Button>
          <Input variant="outline" placeholder="Search" name="name" width="100px" alignSelf="center" />
          <Select placeholder="Select option">
            <option value="option1">Option 1</option>
            <option value="option2">Option 2</option>
            <option value="option3">Option 3</option>
          </Select>
        </Box>
      </Flex>
    )
  }
